class Findfollow extends React.Component{
    constructor(){
        super()
        this.state = {
            non_followers: []
        }
    }

    componentDidMount(){
        const token = localStorage.getItem('token')
        const reqObj = {method: 'GET',
    headers: {
        'Content-Type': 'application/json', 'Authorization': `Bearer ${token}`
    }}
        fetch('http://localhost:3000/users', reqObj)
        .then(resp => resp.json())
        .then(data => {
            this.setState({
                non_followers: data
            })
        })
    }

    render(){
